import React, { useState } from "react";
import "./Counter.css";
function Counter() {
  const [car, setCar] = useState(0);
  let inc = () => {
    setCar(car + 1);
  };
  let dec = () => {
    if (car > 0) {
      setCar(car - 1);
    }
  };
  let clear = () => {
    setCar(0);
  };
  return (
    <div>
      <button
        style={{
          background: "White",
          border: "0",
          borderRadius: "100%",
          width: "70px",
          height: "60px",
          margin: "5px",
        }}
      >
        <h1>{car}</h1>
      </button>
      <br />
      <button id="App" onClick={clear}>
        <h1>CE</h1>
      </button>
      <button
        style={{
          background: "Green",
          border: "0",
          borderRadius: "100%",
          width: "70px",
          height: "60px",
          margin: "5px",
        }}
        onClick={inc}
      >
        <h1>%</h1>
      </button>
      <button
        style={{
          background: "Red",
          border: "0",
          borderRadius: "100%",
          width: "70px",
          height: "60px",
          margin: "5px",
        }}
        onClick={inc}
      >
        <h1>{"<-"}</h1>
      </button>
      <button
        style={{
          background: "Green",
          border: "0",
          borderRadius: "100%",
          width: "70px",
          height: "60px",
          margin: "5px",
        }}
        onClick={inc}
      >
        <h1>/</h1>
      </button>
      <br />
      <button
        style={{
          background: "Blue",
          border: "0",
          borderRadius: "100%",
          width: "70px",
          height: "60px",
          margin: "5px",
        }}
        onClick={inc}
      >
        <h1>7</h1>
      </button>
      <button
        style={{
          background: "Blue",
          border: "0",
          borderRadius: "100%",
          width: "70px",
          height: "60px",
          margin: "5px",
        }}
        onClick={inc}
      >
        <h1>8</h1>
      </button>
      <button id="App2" onClick={inc}>
        <h1>9</h1>
      </button>
      <button id="App1">
        <h1>X</h1>
      </button>
      <br />
      <button id="App2" onClick={inc}>
        <h1>4</h1>
      </button>
      <button id="App2" onClick={inc}>
        <h1>5</h1>
      </button>
      <button id="App2" onClick={inc}>
        <h1>6</h1>
      </button>
      <button id="App1" onClick={dec}>
        <h1>-</h1>
      </button>
      <br />
      <button id="App2" onClick={inc}>
        <h1>1</h1>
      </button>
      <button id="App2" onClick={inc}>
        <h1>2</h1>
      </button>
      <button id="App2" onClick={inc}>
        <h1>3</h1>
      </button>
      <button id="App1" onClick={inc}>
        <h1>+</h1>
      </button>
      <br />
      <button id="App2" onClick={inc}>
        <h1>00</h1>
      </button>
      <button id="App2" onClick={inc}>
        <h1>0</h1>
      </button>
      <button id="App2" onClick={inc}>
        <h1>.</h1>
      </button>
      <button id="App" onClick={inc}>
        <h1>=</h1>
      </button>
    </div>
  );
}

export default Counter;
